const data = [
  {
    title: 'MDN Docs: JS',
    baseURL: 'https://developer.mozilla.org/en-US/',
    extensions: [
      { title: 'Array', url: 'docs/Web/JavaScript/Reference/Global_Objects/Array' },
      { title: 'Object', url: 'docs/Web/JavaScript/Reference/Global_Objects/Object' },
      { title: 'Function', url: 'docs/Web/JavaScript/Reference/Global_Objects/Function' },
      { title: 'async', url: 'docs/Web/JavaScript/Reference/Statements/async_function' },
    ],
  },
  { title: 'Icon Reference', baseURL: 'https://www.w3schools.com/icons/icons_reference.asp', extensions: false },
  { title: 'Google Fonts', baseURL: 'https://fonts.google.com/', extensions: false },
  {
    title: 'WAI-ARIA',
    baseURL: 'https://www.w3.org/TR/wai-aria-practices/',
    extensions: false,
  },
  //   { baseURL: "", extensions: [] },
];

export default data;
